import {
  List,
  ListItemButton,
  ListItem,
  ListItemIcon,
  ListItemText,
} from "@material-ui/core";
import ViewQuiltIcon from "@material-ui/icons/ViewQuilt";

import React from "react";

export default function SideBar() {
  return (
    <>
      <List>
        <ListItemButton alignItems="center" divider>
          <ListItemIcon sx={{ width: 200 }}>
            <img
              src="https://logodix.com/logo/1789832.png"
              alt=""
              className="w-100"
            />
          </ListItemIcon>
        </ListItemButton>
        <ListItem>
          <ListItemIcon>
            <ViewQuiltIcon />
          </ListItemIcon>
          <ListItemText>Dashboard</ListItemText>
        </ListItem>
      </List>
    </>
  );
}
